import React from 'react';
import { Link } from 'react-router-dom';
import '../style.css';
import './Home.css'
import ProjectBox from './ProjectBox';

const Home = () => {
  return (
    <div>
      <h1>Welcome to my website!</h1>
      <p>Here you can learn more about me and my work.</p>
      <section>
        <h2>My Projects</h2>
        <p>Python Event Planner</p>
        <Link to="/projects/python-event-planner">
          <ProjectBox />
        </Link>

      </section>
    </div>
  );
};

export default Home;
